import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { fetchUser } from './services/apiService';
import './Portfolios.css';

const Portfolios = () => {

  const navigate = useNavigate();

  const handlePortfolioClick = () => {
    navigate('/Portfolioslist');
  };

  const handleCameraInputChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      console.log("File selected: ", file);
      // You can add further processing of the file (e.g., upload it, or use a QR code scanner library)
    }
  };

    const [user, setUser] = useState(null);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const response = await fetchUser();
                setUser(response.data);
            } catch (err) {
                console.log("Error fetching user:", err);
            }
        };

        fetchUserData();
    }, []);

    return (

<div className="main_menu_wrapper container">

<div className="text-center mb-4">
{user ? (
  <h5 className="black-text">{user.name}</h5>
) : (
                <p>Loading...</p>
            )}
</div>
<div className="portfoilios">
  <div className="text-center mt-4">
    <div className="qr-code-box p-3 mb-4">
      <div>
        <label htmlFor="cameraInput">
          <img src="/scanner.png" alt="Scan QR Code" className="img-fluid" />
        </label>
        <input
          type="file"
          id="cameraInput"
          accept="image/*"
          capture="environment"
          onChange={handleCameraInputChange}
          style={{ display: 'none' }}
        />
      </div>
      <div className="text-center">
        <h3>Scan QR Code</h3>
      </div>
    </div>
  </div>
  <div className="row">
    <div className="col-6 col-md-3 mb-4">
      <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
        <div>
          <img src="/home.svg" alt="Portfolio 1" className="img-fluid mb-2" />
        </div>
        <div className="mt-2">
          <h4>Portfolio 1</h4>
        </div>
        <div className="mt-2">
          <small>6 items</small>
        </div>
      </div>
    </div>
    <div className="col-6 col-md-3 mb-4">
      <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
        <div>
          <img src="/home.svg" alt="Portfolio 2" className="img-fluid mb-2" />
        </div>
        <div className="mt-2">
          <h4>Portfolio 2</h4>
        </div>
        <div className="mt-2">
          <small>2 items</small>
        </div>
      </div>
    </div>
    <div className="col-6 col-md-3 mb-4">
      <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
        <div>
          <img src="/home.svg" alt="Portfolio 3" className="img-fluid mb-2" />
        </div>
        <div className="mt-2">
          <h4>Portfolio 3</h4>
        </div>
        <div className="mt-2">
          <small>3 items</small>
        </div>
      </div>
    </div>
    <div className="col-6 col-md-3 mb-4">
      <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
        <div>
          <img src="/home.svg" alt="Portfolio 4" className="img-fluid mb-2" />
        </div>
        <div className="mt-2">
          <h4>Portfolio 4</h4>
        </div>
        <div className="mt-2">
          <small>9 items</small>
        </div>
      </div>
    </div>
  </div>
</div>
</div>
    );
};

export default Portfolios;
